    "# Calculate the residuals\n",
    "residuals = Y - ols_fit\n",
    "\n",
    "# Find the MSE of the outliers\n",
    "outlier_indices = [4]\n",
    "outlier_mse = np.mean(residuals[outlier_indices] ** 2)\n",
    "\n",
    "# Find the MSE of the rest of the data\n",
    "non_outlier_indices = [i for i in range(len(X)) if i not in outlier_indices]\n",
    "non_outlier_mse = np.mean(residuals[non_outlier_indices] ** 2)\n",
    "\n",
    "print(\"MSE of outliers (OLS):\", outlier_mse)\n",
    "print(\"MSE of non-outliers (OLS):\", non_outlier_mse)"
